import React from 'react';


export default class Nav extends React.Component{
    render(){
        return(
            <div className="nav-container">
                <h1>Anas Alam</h1>
                <nav>
                    <ul className='nav-ul'>
                        <li>
                           <a href='./Home'>Home</a> 
                        </li>
                        <li>
                            <a href={Projects}>Projects</a>
                        </li>
                        <li>
                            <a href={Contact}>Contact</a>
                        </li>
                    </ul>
                </nav>
            </div>
        );
    }
}
